import React from 'react';

// import './AuctionDetails.css';

export default function AuctionDetails(props) {
  const createdAt = new Date(props.auction.created_at);
  return (
    <div className='container'>
      <h1>Auction Details</h1>
      <h2>{props.auction.title}</h2>
      <p>
        {props.auction.description}<br />
        {props.auction.price}<br />   
      </p>
      <p>
      <small>{ props.auction.id ? props.auction.bidder.full_name : ''}</small>
      <small>Created at {props.createdAt.toString()}</small>
      </p>
    </div>
  )
}
